"use strict";(self.webpackChunk_0420_syj_github_io=self.webpackChunk_0420_syj_github_io||[]).push([[1341],{2478:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"2023-04-24-daily","metadata":{"permalink":"/en/daily/2023-04-24-daily","source":"@site/daily/2023-04-24-daily/index.md","title":"230424 \uc0dd\uac01\uc815\ub9ac \ud83d\ude44","description":"\ubb38\ub4dd \uc0dd\uac01\ub09c \uac83\ub4e4\uc744 \uc815\ub9ac\ud574\ubcf4\uc558\ub2e4.","date":"2023-04-24T00:00:00.000Z","formattedDate":"April 24, 2023","tags":[{"label":"thinking","permalink":"/en/daily/tags/thinking"},{"label":"travel","permalink":"/en/daily/tags/travel"}],"readingTime":2.7,"hasTruncateMarker":true,"authors":[{"name":"\uc2ec\uc644","title":"\ud504\ub860\ud2b8\uc5d4\ub4dc \uac1c\ubc1c\uc790 @ HandHug","url":"https://github.com/0420syj","imageURL":"https://avatars.githubusercontent.com/u/22449484","key":"wannysim"}],"frontMatter":{"slug":"2023-04-24-daily","title":"230424 \uc0dd\uac01\uc815\ub9ac \ud83d\ude44","description":"\ubb38\ub4dd \uc0dd\uac01\ub09c \uac83\ub4e4\uc744 \uc815\ub9ac\ud574\ubcf4\uc558\ub2e4.","image":"./images/calc.png","authors":["wannysim"],"tags":["thinking","travel"],"enableComments":true},"nextItem":{"title":"\uccab \ud3ec\uc2a4\ud2b8\ub294 \uace0\uc591\uc774 \ud83d\udc31","permalink":"/en/daily/first-daily"}},"content":"\ubb38\ub4dd \uc0dd\uac01\ub09c \uac83\ub4e4\uc744 \uc815\ub9ac\ud574\ubcf4\uc558\ub2e4.\\n\\n\x3c!-- truncate --\x3e\\n\\n## \ubd80\uc815\uc801\uc778 \uac10\uc815\uc5d0\uc11c \ubc97\uc5b4\ub098\ub294 \ubc29\ubc95 \ud83e\udde0\\n\\n[LinkedIn](https://www.linkedin.com/posts/stevenouri_if-you-are-stuck-with-a-problem-or-cant-activity-7055883225419694080-9WAw?utm_source=share&utm_medium=member_desktop)\uc5d0\uc11c \uc7ac\ubc0c\ub294 \uae00\uc744 \uc77d\uc5c8\ub2e4.\\n\\n\ub1cc\uacfc\ud559 \uad00\ub828 [\ub17c\ubb38](https://www.sciencedirect.com/science/article/pii/S0306452209001171)\uc744 \uc77d\uace0 \uc815\ub9ac\ud55c \uae00\uc778\ub370, \ub300\ucda9 *\uac77\uae30\uc640 \uac19\uc740 \uc911\uac04 \uac15\ub3c4\uc758 \uc720\uc0b0\uc18c \uc6b4\ub3d9\uc774 \uc0ac\ucd98\uae30 \uc804 \uc544\ub3d9\uc758 \uc8fc\uc758\ub825 \uc870\uc808 \ub2a5\ub825 \ud5a5\uc0c1\uc5d0 \ub3c4\uc6c0\uc774 \ub41c\ub2e4*\ub77c\ub294 \ub0b4\uc6a9\uc774\ub2e4.\\n\\n\uadf8\uac83\ubcf4\ub2e4 \ub354 \uc7ac\ubc0c\ub294 \uac83\uc740, \uae00\uc758 \ub9c8\uc9c0\ub9c9\uc5d0 \uc788\ub294 \ubd80\ubd84\uc774\ub2e4.\\n\\n:::info \ubd80\uc815\uc801\uc778 \uac10\uc815\uc5d0\uc11c \ubc97\uc5b4\ub098\ub294 \ubc29\ubc95\\n\\n- Tired \u27a1\ufe0f Nap\\n- Sad \u27a1\ufe0f Music\\n- Cant focus\u27a1\ufe0f Cut screen time\\n- Angry \u27a1\ufe0f Exercise\\n- Burnt out \u27a1\ufe0f Read\\n- Anxious \u27a1\ufe0f Meditate\\n- Feeling lost \u27a1\ufe0f Pray\\n- Overwhelmed \u27a1\ufe0f Take a break\\n- Restless \u27a1\ufe0f Yoga\\n- Nervous \u27a1\ufe0f Deep breaths\\n- Unmotivated \u27a1\ufe0f Set small goals\\n\\n:::\\n\\n\ub300\ubd80\ubd84\uc740 \uacf5\uac10\ub418\ub294 \ub0b4\uc6a9\uc774\uc5c8\ub2e4. \uc77c\ubd80\ub294 \ud574\uc11d \uc790\uccb4\uac00 \uc5b4\ub824\uc6e0\ub2e4.\\n\\n\uc5b4\uca0b\ub4e0 \ubd80\uc815\uc801\uc778 \uac10\uc815\uc774 \ub4e4 \ub54c, \uc774 \uae00\uc744 \ubcf4\uace0 \uc5b4\ub5a4 \uac83\uc744 \ud574\uc57c\ud560\uc9c0 \uace0\ubbfc\ud574\ubcf4\uae30\ub85c \ud558\uc790.\\n\\n## \uc77c\ubcf8 \uc5ec\ud589 \uc900\ube44 \ud83d\uddd2\ufe0f\\n\\n\uc774\uc9c1 \uc804 \ud734\uac00\uae30\uac04\uc774 \ub9ce\uc774 \uc0dd\uaca8\uc11c \uc77c\ubcf8 \uc5ec\ud589\uc744 \uacc4\ud68d\ud558\uace0 \uc788\ub2e4. \ub2f9\uc7a5 \uc774\ubc88 \uc8fc \ubaa9\uc694\uc77c\uc774\ub2e4.\\n\\n\uc695\uc2ec\uc744 \ub9ce\uc774 \ub0c8\ub354\ub2c8 \uba38\ub9ac \uc544\ud504\ub2e4. \uc77c\ubcf8\uc5d0 \ub300\ud55c \uc9c0\uc2dd\uc774 \ubd80\uc871\ud574\uc11c \ub354 \uadf8\ub7f0 \uac83 \uac19\ub2e4. \uac00\uc788\ub294 \ub3d9\uc548\uc5d0\ub3c4 \ube14\ub85c\uae45\ud574\uc57c\uaca0\ub2e4!\\n\\n## \uc5ec\ud589 \uc6f9\uc571\uc5d0 \ub300\ud55c \uace0\ubbfc \ud83e\udd14\\n\\n\uc9c0\ub09c 12\uc6d4 \uc7ac\ubbf8\ub85c \uc5ec\ud589\uc5d0 \ub3c4\uc6c0\uc774 \ub418\ub294 \uc6f9\uc571\uc744 \ub9cc\ub4e4\uae30 \uc2dc\uc791\ud588\ub2e4. \ub098\uc5d0\uac8c \uc774\uc9c1\uc758 \uacc4\uae30\ub97c \ub9cc\ub4e4\uc5b4\uc900 \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158\uc774\ub2e4.\\n\\n![\ucea1\ucc98 \uc774\ubbf8\uc9c0](./images/calc.png)\\n\\n:::note \ub300\ud45c \uae30\ub2a5\\n\\n- \ud658\uc728 \uacc4\uc0b0\uae30\\n- \uc5ec\ud589 \ud68c\ud654\ubb38\uc7a5\\n- \uae30\uc0c1\uccad \ub9c1\ud06c\\n- \uc5ec\ud589\uc9c0 LiveCam \ub9c1\ud06c\\n- \ub4f1\ub4f1...\\n\\n:::\\n\\n\uc720\ub7fd\ub54c \ub123\uc5c8\ub358 \ub370\uc774\ud130\ub97c \uc77c\ubcf8 \uc624\uc0ac\uce74&\ub3c4\ucfc4\ub85c \ubc14\uafe8\ub2e4.\\n\\n\uadf8\ub7f0\ub370 \uc815\ub9d0 \ub300\ucda9 \ub9cc\ub4e4\uc5b4\uc11c \ud655\uc7a5\uc131\uc774 \ub108\ubb34 \ub5a8\uc5b4\uc9c4\ub2e4. \uc81c\ubc95 \uad1c\ucc2e\uc740 \uae30\ub2a5\uc774 \ub9ce\uc774 \uc788\uc5b4\uc11c \uc544\ud0a4\ud14d\ucc98\ub97c \uac1c\uc120\ud558\uba74 \uc55e\uc73c\ub85c\ub3c4 \ub9ce\uc774 \uc4f8 \uc218 \uc788\uc744 \uac83 \uac19\uc740\ub370 \ub9d0\uc774\ub2e4.\\n\\n\uae30\ud68c\uac00 \ub418\uba74 \ub9ac\ud329\ud1a0\ub9c1\uc744 \ud574\ubcf4\uace0 public repo\ub85c \uc62c\ub824\uc57c\uaca0\ub2e4. (\uc9c0\uae08\uc740 private\uc774\ub2e4\ud83d\ude05)"},{"id":"first-daily","metadata":{"permalink":"/en/daily/first-daily","source":"@site/daily/2023-04-22-first-daily/index.md","title":"\uccab \ud3ec\uc2a4\ud2b8\ub294 \uace0\uc591\uc774 \ud83d\udc31","description":"\uc77c\uc0c1\uc801\uc778 \ub0b4\uc6a9\uc744 \uae30\ub85d\ud558\ub294 \uacf5\uac04\uc744 \ub9cc\ub4e4\uc5c8\uc2b5\ub2c8\ub2e4. \uc624\ub298\uc758 \uc8fc\uc81c\ub294 \uace0\uc591\uc774\uc785\ub2c8\ub2e4.","date":"2023-04-22T00:00:00.000Z","formattedDate":"April 22, 2023","tags":[{"label":"cat","permalink":"/en/daily/tags/cat"}],"readingTime":1.43,"hasTruncateMarker":true,"authors":[{"name":"\uc2ec\uc644","title":"\ud504\ub860\ud2b8\uc5d4\ub4dc \uac1c\ubc1c\uc790 @ HandHug","url":"https://github.com/0420syj","imageURL":"https://avatars.githubusercontent.com/u/22449484","key":"wannysim"}],"frontMatter":{"slug":"first-daily","title":"\uccab \ud3ec\uc2a4\ud2b8\ub294 \uace0\uc591\uc774 \ud83d\udc31","description":"\uc77c\uc0c1\uc801\uc778 \ub0b4\uc6a9\uc744 \uae30\ub85d\ud558\ub294 \uacf5\uac04\uc744 \ub9cc\ub4e4\uc5c8\uc2b5\ub2c8\ub2e4. \uc624\ub298\uc758 \uc8fc\uc81c\ub294 \uace0\uc591\uc774\uc785\ub2c8\ub2e4.","image":"./images/maru-aki.jpg","authors":["wannysim"],"tags":["cat"],"enableComments":true},"prevItem":{"title":"230424 \uc0dd\uac01\uc815\ub9ac \ud83d\ude44","permalink":"/en/daily/2023-04-24-daily"}},"content":"\uc77c\uc0c1\uc801\uc778 \ub0b4\uc6a9\uc744 \uae30\ub85d\ud558\ub294 \uacf5\uac04\uc744 \ub9cc\ub4e4\uc5c8\uc2b5\ub2c8\ub2e4. \uc624\ub298\uc758 \uc8fc\uc81c\ub294 \uace0\uc591\uc774\uc785\ub2c8\ub2e4.\\n\\n\x3c!-- truncate --\x3e\\n\\n## \ubb34\uc2a8 \ub0b4\uc6a9\uc744 \uc4f0\uba74 \uc88b\uc744\uae4c\uc694? \ud83e\udd14\\n\\n\uc77c\uae30\uc7a5\ubcf4\ub2e4\ub294 \uc870\uae08 public\ud55c \ub290\ub08c\uc73c\ub85c \uc4f0\uace0 \uc2f6\uc5b4\uc11c, \ube14\ub85c\uadf8\uc5d0 **\uc77c\uc0c1** \uce74\ud14c\uace0\ub9ac\ub97c \ub9cc\ub4e4\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\uc624\ub298\uc740 \uadf8\ub0e5 \uc800\uc758 \uace0\uc591\uc774\ub2d8 \ub450 \ubd84\uc744 \uc18c\uac1c\ud574\ub4dc\ub9b4\uae4c \ud569\ub2c8\ub2e4.\\n\\n## \uba38\ub8e8 \ud83d\udc31\\n\\n![\uba38\ub8e8](./images/maru.jpg)\\n\\n\uc0ac\ub0e5\ub180\uc774\ub97c \uad49\uc7a5\ud788 \uc88b\uc544\ud558\ub294 **\uba38\ub8e8**\uc785\ub2c8\ub2e4.\\n\uac00\uc7a5 \uc88b\uc544\ud558\ub294 \uc6f9\ud230\uc778 [\ud658\uc0dd\ub3d9\ubb3c\ud559\uad50](https://series.naver.com/comic/detail.series?productNo=3050030)\uc758 \uce90\ub9ad\ud130 [\uba38\ub8e8](https://namu.wiki/w/%ED%99%98%EC%83%9D%EB%8F%99%EB%AC%BC%ED%95%99%EA%B5%90/%EB%93%B1%EC%9E%A5%EC%9D%B8%EB%AC%BC#s-1.2.1)\uc5d0\uc11c \ub530\uc654\uc2b5\ub2c8\ub2e4.\\n\\n\uc9c0\uae08\ub3c4 \ub180\uc544\ub2ec\ub77c\uace0 \uc2dc\uc704\uc911\uc774\uc5d0\uc694.\\n\\n## \uc544\ud0a4 \ud83d\udc31\\n\\n![\uc544\ud0a4](./images/aki.jpg)\\n\\n\uc560\uad50\uac00 \ub118\uce58\ub294 **\uc544\ud0a4**\uc785\ub2c8\ub2e4.\\n\ub9c8\ucc2c\uac00\uc9c0\ub85c \uc6f9\ud230 [\ud658\uc0dd\ub3d9\ubb3c\ud559\uad50](https://series.naver.com/comic/detail.series?productNo=3050030)\uc758 \uce90\ub9ad\ud130 [\uc544\ud0a4](https://namu.wiki/w/%ED%99%98%EC%83%9D%EB%8F%99%EB%AC%BC%ED%95%99%EA%B5%90/%EB%93%B1%EC%9E%A5%EC%9D%B8%EB%AC%BC#s-1.2.5)\uc5d0\uc11c \ub530\uc654\uc2b5\ub2c8\ub2e4.\\n\\n\ucef4\ud4e8\ud130 \uc55e\uc5d0 \uc788\uc73c\uba74, \uc4f0\ub2e4\ub4ec\uc5b4\ub2ec\ub77c\uace0 \uba38\ub9ac\ub97c \ub4e4\uc774\ub300\ub294 \ud3b8\uc785\ub2c8\ub2e4.\\n\\n## \uc0ac\uc774\uac00 \ucc38 \uc88b\uc544\uc694 \ud83e\udd17\\n\\n![\uba38\ub8e8\uc640 \uc544\ud0a4](./images/maru-aki.jpg)\\n\\n\uba38\ub8e8\uc640 \uc544\ud0a4\ub294 \uc0ac\uc774\uac00 \ucc38 \uc88b\uc544\uc694.\\n\uc11c\uc5f4\uc740 \uba38\ub8e8\uac00 \ub354 \ub192\uc2b5\ub2c8\ub2e4 \ud83d\ude0e"}]}')}}]);